import { Button, Card } from "@mantine/core";
import React, { useEffect } from "react";
import './Page.css';
import { useState } from "react";
import Modal_Control from './Modal_Control'
import { MonthPickerInput } from "@mantine/dates";
import { TextInput,NumberInput,Select } from "@mantine/core";

function Bought()
{
    return(
        <div>
            <center style={{width:"fit-content"}}><MonthPickerInput minDate="2000-01-01" maxDate="2023-08-01" label="Select month and year" /></center>
            <h1>This is bought page</h1>
        </div>
    )
}

function Cart()
{  
    const [content,setContent]=useState(<Content/>)
    const [modal,setModal]=useState(<Modal/>)
    const[name,setName]=useState('')
    const[quantity,setQuantity]=useState(1)
    const[type,setType]=useState('Numbers')
    const [rel,setRel]=useState(<Modal_Control  modal={content} content={modal}/>)
    useEffect(()=>{Do()},[name,quantity,type])
    
    function Modal()
    {
     return(<h1>Hello World</h1>)
    }
 
    function Content()
    {
    const date = new Date()
    return(
        <div>
        <table className="Table" cellPadding={30}>
            <tbody>
                <tr>
                    <td colSpan={3}><center><h1>Add Item</h1></center></td>
                </tr>
                <tr>
                    <td>
                    <TextInput placeholder="Name" label='Name' id="Name" onChange={(e)=>{console.log(e.target.value)}} withAsterisk />
                    </td>
                    <td>
                        <NumberInput  min={0.25} defaultValue={quantity} step={0.05} precision={2} onChange={(e)=>{setQuantity(e)}} label="Quantity"/>
                    </td>
                    <td>
                        <Select label='Type' defaultValue={type} searchable data={['Numbers','Kilograms','Grams','Litre','Dozen']} onChange={(e)=>{setType(e)}}/>
                    </td>
                </tr>
                <tr>
                    <td colSpan={3}>
                    <center><Button id='add_button' onClick={()=>{
                        console.log(name)
                    }}>ADD</Button></center>
                    </td>
                </tr>
            </tbody>
        </table>
        
        </div>
    )
}

function Do(){
    
    setModal(<Modal/>)
    setRel(<Modal_Control  modal={content} content={modal}/>)
   }
  

     return(
        <div >
            <Button className="Cart_Button" onClick={()=>{setRel(Bought())}}>Bought</Button>
            <Button className="Cart_Button" onClick={Do}>Pending</Button>
            <Card className="Cart_card">
            {rel}
            </Card>
        </div>
    )
}

export default Cart
